package com.demo;

public class ForLoopExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
           
		
		  int num;
		  for(int a=1;a<=10;a++) {
			for(int b=2;b<=10;b++)  {
				
				num=a*b;
			
					System.out.print(num+" ");
				}
				
			System.out.println();
				

			}
		}
			
	}


